export let DisplayPokemons = ({pokemons}) => {
    if (pokemons === undefined) return
    return (
        <div >

            {pokemons.map(p => {

                return <div>

                    <h4 >pokemon numer {p.number}:</h4>
                    <div>
                        {p.forEach(key => {
                            <h5>{key}: {p[key]}</h5>
                        })}
                    </div>

                </div>
            })}
        </div>
    );
}
